import React from "react";
import axios from "axios";
import { useState, useEffect } from "react";

const IndiaCluster = () => {
    const [myIndiaData, setIndiaClusterData] = useState([])
    const [myLabels, setmyLabels] = useState([])
    const [myTitle, setmyTitle] = useState([])
    const [myData, setMyData] = useState([])

    useEffect(() => {
        axios.get('./india.json')
          .then((res) => setMyData(res.data)
        )
      }, []);

    useEffect(() => {
        axios.get('./india/india-cluster.json')
          .then((res) => {
            setIndiaClusterData(res.data.clusters)
            //setmyLabels(res.data.label_counts)
            //setmyTitle(res.data.clusters)
          }
        )
    }, [])

    //console.log(myIndiaData)

    return (
        <div className="videoDetails">  
            <div className="videoDetails-data">
                {
                myData.map((post) => {
                    let { title, faculty, domain, keyframes_text } = post
                    return (<div>{title}</div>)
                })
                }
            </div>
        </div>
    )
}

export default IndiaCluster

